  root: {
    minHeight: "100vh",
    backgroundColor: "black",
    width: "100%",
    color: "white",
    display: "flex",
    flexDirection:'column',
    justifyContent: "center" /* align horizontal */,
    alignItems: "center",
  },
  title: {
    fontFamily: "Raleway",
  },
  container: {
    backgroundColor: "white",
    minHeight: "450px",
    minWidth:'400px',
   justifyContent:'space-between',
    display: "flex",
  },
  p: {
    color: "white",
    minWidth: '30px',
    margin:' 100px ',
    fontSize:21
  },
  image:{
    objectFit:'fill',
    borderRadius: '210px'
  }
}));
function App() {
  const classes = styles();
  return (
    <CssBaseline>
      <div className={classes.root}>
        <h1 className={classes.title}>Dario Sponchiado</h1>
        <img className={classes.image} src={image} alt="me"></img>
        <p className={classes.p}>Hi.. i'm dario, i am a develop website(html, css, javascript, php, sql, and framework like: react, angular node and more.. ) and apps(react-native, flutter, xamarin) for passion, i study at ca-foscari university on 1Â° year, </p>
      </div>
    </CssBaseline>
  );
}

export default App;
